-- ----------------------------
-- Procedure structure for FindParent
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindParent`;
delimiter ;;
CREATE PROCEDURE `FindParent`(IN dept_id INT)
BEGIN
SET @prev_dept_id = NULL;
-- 调用存储过程
CALL FindTopParent1(6, @prev_dept_id);
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for FindSubDepartments
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindSubDepartments`;
delimiter ;;
CREATE PROCEDURE `FindSubDepartments`(IN dept_id INT)
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE cur_department_id INT;
    DECLARE cur_parent_id INT;
    
    DECLARE cur CURSOR FOR
        SELECT id, parent_id
        FROM sdm_system_dept
        WHERE parent_id = dept_id;
        
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;
    
    read_loop: LOOP
        FETCH cur INTO cur_department_id, cur_parent_id;
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        -- 输出当前部门信息
        SELECT * FROM sdm_system_dept WHERE id = cur_department_id;

        -- 递归调用存储过程
        CALL FindSubDepartments(cur_department_id);
    END LOOP;
    
    CLOSE cur;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for FindTopParent
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindTopParent`;
delimiter ;;
CREATE PROCEDURE `FindTopParent`(IN dept_id INT, IN prev_dept_id INT,OUT dept_name VARCHAR(64),IN cur_sno VARCHAR(150))
BEGIN
    DECLARE cur_parent_id INT;
    DECLARE cur_dept_name VARCHAR(64);
    
    SELECT parent_id INTO cur_parent_id
    FROM sdm_system_dept
    WHERE id = dept_id;
    
    IF cur_parent_id IS NULL THEN
        -- 输出前一个部门信息
				SELECT name INTO cur_dept_name
        FROM sdm_system_dept
        WHERE id = prev_dept_id;
    ELSE
        -- 递归调用存储过程
        CALL FindTopParent(cur_parent_id, dept_id,dept_name,cur_sno);
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for FindTopParent1
-- ----------------------------
DROP PROCEDURE IF EXISTS `FindTopParent1`;
delimiter ;;
CREATE PROCEDURE `FindTopParent1`(IN dept_id INT, IN prev_dept_id INT)
BEGIN
    DECLARE cur_parent_id INT;
    DECLARE cur_dept_name VARCHAR(255);
    
    SELECT parent_id INTO cur_parent_id
    FROM sdm_system_dept
    WHERE id = dept_id;
    
    IF cur_parent_id IS NULL THEN
        -- 输出前一个部门信息
				SELECT * FROM sdm_system_dept WHERE id = prev_dept_id;
    ELSE
        -- 递归调用存储过程
        CALL FindTopParent1(cur_parent_id, dept_id);
    END IF;
END
;;
delimiter ;

