-- ----------------------------
-- Procedure structure for 获取学生学院名称
-- ----------------------------
DROP PROCEDURE IF EXISTS `获取学生学院名称`;
delimiter ;;
CREATE PROCEDURE `获取学生学院名称`()
BEGIN
DECLARE done INT DEFAULT FALSE;
DECLARE tmpid bigint;
DECLARE tmpsno VARCHAR(150);
DECLARE cur CURSOR FOR SELECT dept_id,username FROM sdm_system_users;
DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
OPEN cur;
read_loop:LOOP
FETCH cur INTO tmpid,tmpsno;
IF done THEN
LEAVE read_loop;
ELSE
SET @prev_dept_id = NULL;
SET @prev_dept_name = NULL;
CALL FindTopParent(tmpid, @prev_dept_id, @prev_dept_name,tmpsno);
-- INSERT test(sno) VALUES(tmpsno);
END IF;
END LOOP;
CLOSE cur;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table 学生信息表
-- ----------------------------
DROP TRIGGER IF EXISTS `check_student_id`;
delimiter ;;
CREATE TRIGGER `check_student_id` BEFORE INSERT ON `学生信息表` FOR EACH ROW BEGIN
    DECLARE user_count INT;

    -- Check if the NEW value of 学号字段 exists in the specified condition
    SELECT COUNT(*)
    INTO user_count
    FROM sdm_system_users
    JOIN sdm_system_users_role ON sdm_system_users.id = sdm_system_users_role.users_id
    WHERE sdm_system_users_role.role_id = 4
      AND sdm_system_users.username = NEW.`学号_id`;

    -- If the NEW value doesn't satisfy the condition, raise an error
    IF user_count = 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid student ID for this operation';
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table 学生信息表
-- ----------------------------
DROP TRIGGER IF EXISTS `add_student`;
delimiter ;;
CREATE TRIGGER `add_student` AFTER INSERT ON `学生信息表` FOR EACH ROW BEGIN
    DECLARE building_num  VARCHAR(250);
    DECLARE dormitory_num INT;
    
    -- Retrieve the building number and dormitory number for the student number in the application form
    SELECT `楼号`, `宿舍号`
		INTO  building_num, dormitory_num 
    FROM  `学生信息表` 
    WHERE `学号_id` = NEW.`学号_id`;
    
    -- Increase the number of empty beds by 1 in the dormitory information table
    UPDATE `宿舍信息表` 
    SET  `空床位数` = `空床位数` - 1 
    WHERE `楼号` = building_num AND `宿舍号` = dormitory_num;
END
;;
delimiter ;

