DROP TRIGGER IF EXISTS `宿舍信息_楼号_check_insert`;
delimiter ;;
CREATE TRIGGER `宿舍信息_楼号_check_insert` BEFORE INSERT ON `宿舍信息表` FOR EACH ROW BEGIN
    DECLARE user_count INT;

    -- Check if the NEW value of 学号字段 exists in the specified condition
    SELECT COUNT(*)
    INTO user_count
    FROM sdm_system_dept
    WHERE sdm_system_dept.name = NEW.`楼号` and sdm_system_dept.parent_id in (select id from sdm_system_dept where name = '宿舍名称');

    -- If the NEW value doesn't satisfy the condition, raise an error
    IF user_count = 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid student ID for this 楼号';
    END IF;
END
;;
delimiter ;

