-- ----------------------------
-- Triggers structure for table 申请表
-- ----------------------------
DROP TRIGGER IF EXISTS `防止插入选项被设置为空`;
delimiter ;;
CREATE TRIGGER `防止插入选项被设置为空` BEFORE INSERT ON `申请表` FOR EACH ROW BEGIN
    IF NEW.选项 NOT IN ('留校申请', '换宿申请', '退宿申请') THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = '选项值无效，必须为留校申请、换宿申请或退宿申请中的一个';
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table 申请表
-- ----------------------------
DROP TRIGGER IF EXISTS `自动设置床号_宿舍号`;
delimiter ;;
CREATE TRIGGER `自动设置床号_宿舍号` BEFORE INSERT ON `申请表` FOR EACH ROW BEGIN
		DECLARE creator_id_val INT;
		DECLARE creator_id_val2 INT;
    IF NEW.选项 = '换宿申请' THEN
        IF NEW.床号 IS NULL OR NEW.宿舍号 IS NULL THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = '当选项字段为''换宿申请''时，床号和宿舍号不能为空';
        END IF;
		ELSE

			SELECT `床号`, `宿舍号` INTO creator_id_val, creator_id_val2
					FROM `学生信息表`, `sdm_system_users`
					WHERE NEW.creator_id = `sdm_system_users`.`id`
							AND `sdm_system_users`.username = `学生信息表`.`学号_id`;

					IF creator_id_val IS NOT NULL AND creator_id_val2 IS NOT NULL THEN
							SET NEW.床号 = creator_id_val;
							SET NEW.宿舍号 = creator_id_val2;
					ELSE
							-- 如果床号或宿舍号为空，可以选择抛出错误或者进行其他处理
							SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = '床号或宿舍号不能为空';
					END IF;
    END IF;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table 申请表
-- ----------------------------
DROP TRIGGER IF EXISTS `change_dormitory`;
delimiter ;;
CREATE TRIGGER `change_dormitory` AFTER INSERT ON `申请表` FOR EACH ROW BEGIN
    DECLARE building_num  varchar(255);
    DECLARE dormitory_num INT;
    
    -- Retrieve the building number and dormitory number for the student number in the application form
    SELECT `楼号`, `宿舍号`
		INTO  building_num, dormitory_num 
    FROM  `学生信息表` 
    WHERE `学号_id` = NEW.`学号_id`;
    
    -- Increase the number of empty beds by 1 in the dormitory information table
    UPDATE `宿舍信息表` 
    SET  `空床位数` = `空床位数` + 1 
    WHERE `楼号` = building_num AND `宿舍号` = dormitory_num;
END
;;
delimiter ;

