-- Triggers structure for table 申请表
-- ----------------------------
DROP TRIGGER IF EXISTS `delete_student_info`;
delimiter ;;
CREATE TRIGGER `delete_student_info` AFTER INSERT ON `申请表` FOR EACH ROW BEGIN
    IF NEW.`选项` = '退宿申请' THEN
        DELETE FROM `学生信息表`
        WHERE `学号_id` = NEW.`学号_id`;
    END IF;
END
;;
delimiter ;

